import React from "react";

const Calculator = () => {
  return (
    <div>
      <div className="container"></div>
      <div className="display">
        <div>
          <span>(0)</span>0
        </div>
        <div>
          <button>/</button>
          <button>*</button>
          <button>-</button>
          <button>+</button>
          <button>DEL</button>
        </div>
      </div>
    </div>
  );
};

export default Calculator;
